import axios from "axios"
import { GET_SERVER_ERRORS } from "./types"

// Get server info
export const serverInfo = serverName => dispatch => {
  axios
    .get("/api/servers/info")
    .then(res => {
      console.log(res.data.data.name)
      const name  = res.data.data.name
      console.log(name)
      return name
    })
    .catch(err =>
      dispatch({
        type: GET_SERVER_ERRORS,
        payload: err.response.data
      })
    )
}
